tables.table_schema:
CREATE TABLE celebrity_backup (
    id INT PRIMARY KEY,
    celebrity_name VARCHAR(255) NOT NULL,
    backup_date DATE NOT NULL,
    backup_location VARCHAR(255) NOT NULL
);

CREATE TABLE celebrity (
    id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    age INT,
    occupation VARCHAR(255)
);

CREATE TABLE backup_history (
    backup_id INT PRIMARY KEY,
    backup_date DATE,
    backup_time TIME,
    details TEXT
);

CREATE TABLE celebrity_info (
    id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL,
    age INT,
    occupation VARCHAR(255)
);

CREATE TABLE backup_history (
    backup_id INT PRIMARY KEY,
    backup_date DATE,
    backup_method VARCHAR(255) NOT NULL
);

CREATE TABLE backup_storage (
    storage_id INT PRIMARY KEY,
    storage_location VARCHAR(255) NOT NULL,
    storage_capacity BIGINT
);

CREATE TABLE backup_logs (
    log_id INT PRIMARY KEY,
    backup_date TIMESTAMP NOT NULL,
    success BOOLEAN,
    details TEXT
);

CREATE TABLE Celebrities (
    id INT PRIMARY KEY,
    name VARCHAR,
    age INT,
    profession VARCHAR
);

CREATE TABLE Awards (
    award_id INT PRIMARY KEY,
    name VARCHAR,
    event VARCHAR,
    year INT
);

CREATE TABLE Relationships (
    relationship_id INT PRIMARY KEY,
    celebrity_id INT,
    partner_id INT,
    relationship_type VARCHAR
);
